/* VCD dumping functions */
MOD_mkTop_bsim & mkTop_bsim_backing(tSimStateHdl simHdl)
{
  static MOD_mkTop_bsim *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkTop_bsim(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkTop_bsim::dump_VCD_defs()
{
  (mkTop_bsim_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkTop_bsim::dump_VCD(tVCDDumpType dt)
{
  (mkTop_bsim_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkTop_bsim_backing(sim_hdl));
}
